import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap'
import 'react-toastify/dist/ReactToastify.css';

function SignUp() {

  const [nome, setNome] = useState('')
  const [cpf, setCpf] = useState('')
  const [email, setEmail] = useState('')
  const [endereco, setEndereco] = useState('')



  const handleClick = (e) => {
    e.preventDefault()
    const usuario = { nome, cpf, email, endereco }
    console.log(usuario)
    fetch("http://localhost:8080/all", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(usuario)

    }).then(() => {
        console.log("Cadastro realizado com sucesso!")
        window.alert("Cadastro realizado com Sucesso!")
    })
}


  return (
      <div className='form__container'>
          <h1>CADASTRE-SE</h1>
          <Form>
            
            <Form.Group className="mb-3" controlId="formBasicName">
              <Form.Label>Nome</Form.Label>
              <Form.Control type="text" placeholder="Digite seu nome" onChange={(e) => setNome(e.target.value)}/>
            </Form.Group>   
            <Form.Group className="mb-3" controlId="formBasic">
              <Form.Label>CPF</Form.Label>
              <Form.Control type="text" placeholder="Digite seu CPF" onChange={(e) => setCpf(e.target.value)} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label>E-mail</Form.Label>
              <Form.Control type="e-mail" placeholder="Digite seu e-mail" onChange={(e) => setEmail(e.target.value)} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicAdress">
              <Form.Label>EndereÃ§o</Form.Label>
              <Form.Control type="text" placeholder="Digite seu endereÃ§o" onChange={(e) => setEndereco(e.target.value)}/>
            </Form.Group>


            <Button variant="primary" type="submit" onClick={handleClick}>
              Confirme
            </Button>
          </Form>
        </div>
  );
}

export default SignUp;
